import React from 'react';
import {
  MDBNavbar, MDBNavbarBrand, MDBNavbarToggler
} from "mdbreact";
import HeaderNav from './pages/sections/HeaderNav';


class Header extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }


  render() {

    return (
      <div>
        <header>
          <MDBNavbar color="default-color" dark expand="md" scrolling fixed="top">
            <MDBNavbarBrand>
              <strong className="white-text">Bucket.PK</strong>
            </MDBNavbarBrand>
            <MDBNavbarToggler onClick={this.onClick} />
            {this.props.loggedIn ? <HeaderNav loggedOut={this.props.loggedOut} /> : null}
          </MDBNavbar>
        </header>
      </div>
    );
  }
}

export default Header
